def ave(array):
    result = []
    for i in range(len(array[0])):
        result.append(np.mean(array[:, i]))
    return result


def final(LASSO, One, DECC_CL):
    LASSO_final = LASSO[:, len(LASSO[0])-1]
    One_final = One[:, len(One[0]) - 1]
    DECC_CL_final = DECC_CL[:, len(DECC_CL[0]) - 1]

    print('DECC_L final: ', '%e' % np.mean(LASSO_final), '±', '%e' % np.std(LASSO_final, ddof=1))
    print('One final: ', '%e' % np.mean(One_final), '±', '%e' % np.std(One_final, ddof=1))
    print('DECC_CL final: ', '%e' % np.mean(DECC_CL_final), '±', '%e' % np.std(DECC_CL_final, ddof=1))


def Normalization(Matrix):
    max_len = 0
    for v in Matrix:
        max_len = max(max_len, len(v))
    for v in Matrix:
        while len(v) < max_len:
            value = v[0]
            v.insert(0, value)
    return Matrix


def Holm(LASSO, Normal, One, DECC_DG, DECC_D, DECC_G, test):
    result = {'L_N': test(LASSO, Normal)[1], 'L_O': test(LASSO, One)[1],
              'L_DG': test(LASSO, DECC_DG)[1], 'L_D': test(LASSO, DECC_D)[1],
              'L_G': test(LASSO, DECC_G)[1], 'N_O': test(Normal, One)[1],
              'N_DG': test(Normal, DECC_DG)[1], 'N_D': test(Normal, DECC_D)[1],
              'N_G': test(Normal, DECC_G)[1], 'O_DG': test(One, DECC_DG)[1],
              'O_D': test(One, DECC_D)[1], 'O_G': test(One, DECC_G)[1],
              'DG_D': test(DECC_DG, DECC_D)[1], 'DG_G': test(DECC_DG, DECC_G)[1],
              'D_G': test(DECC_D, DECC_G)[1]}
    result = dict(sorted(result.items(), key=lambda d: d[1]))
    flag = len(result)
    for (k, v) in result.items():
        result[k] = v * flag
        flag -= 1
    return result


